import React,{useState} from 'react';

export default function ImageHolder(){
  const [addImages,setAddImages] = useState([])

  function addImage(){
    setAddImages([...addImages,""])
  }

  const d = new Date();

    return(
      <div>
      {
        addImages.map((image,index)=>{
          return(
            <div key={index}>
              <div>
                <div className="contnt_2">
                  <div className="div_a">
                    <div className="div_title">User Interface PSD Source files Web Designing for web</div>
                    <div className="btm_rgt">
                      <div className="btm_arc">df</div>
                    </div>
                    <div className="div_top">
                      <div className="div_top_lft"><img src="images/img_6.png" />{localStorage.getItem('email')}</div>
                      <div className="div_top_rgt"><span className="span_date">{d.getDate()}/{d.getMonth}</span><span className="span_time">11:15am</span></div>
                    </div>
                    <div className="div_image"><img id="image-upload" src="imgs/1.jpg" alt="pet" /></div>
                    <div className="div_btm">
                      <div className="btm_list">
                        <ul>
                          <li><a href="#"><span className="btn_icon"><img src="images/icon_001.png" alt="share" /></span>Share</a></li>
                          <li><a href="#"><span className="btn_icon"><img src="images/icon_002.png" alt="share" /></span>Flag</a></li>
                          <li><a href="#"><span className="btn_icon"><img src="images/icon_003.png" alt="share" /></span>0 Likes</a></li>
                          <li><a href="#"><span className="btn_icon"><img src="images/icon_004.png" alt="share" /></span>4 Comments</a></li>
                        </ul>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          );
        })
      }
      <button type='submit' onClick={()=>addImage()}>Submit</button>
      </div>
    );
}
